import React from "react";

import Playlist from "./Playlist";

import { Wrapper, Content } from "./Grid.styles.js";

const Grid = ({ header, children }) => (
  <Wrapper>
    <h1>{header}</h1>
    <Content>
      <Playlist />
    </Content>
  </Wrapper>
);

export default Grid;
